import React from "react";
import Header from "./Header.jsx"
import Card from "./Card.jsx"
import contacts from "../contacts"

function App(){
  return (
    <div>
      {contacts.map(function(contact){
        return(
          <div>
          <Header listName = "My Contacts" />
            <Card id = {contact.id}
              name = {contact.name} 
              img = {contact.imgURL}
              phoneNumber = {contact.phone}
              email= {contact.email}


             />
          </div>
        )
      })}
    </div>
  )
}





export default App;
